import React from "react";

function ResultCard({ result }) {
  if (!result) return null;

  const offers = result.loans || []; // <-- matches backend key

  return (
    <div style={{ border: "1px solid #ccc", padding: "1rem", borderRadius: "8px", marginTop: "20px" }}>
      <h3>Loan Eligibility Result</h3>
      <p><strong>Status:</strong> {result.eligible ? "✅ Eligible" : "❌ Not Eligible"}</p>
      <p><strong>CIBIL Score:</strong> {result.cibil_score}</p>
      <p><strong>Predicted Max Loan:</strong> {result.predicted_amount}</p>

      <h4>Available Loan Offers:</h4>
      <ul>
        {offers.length > 0 ? (
          offers.map((loan, idx) => (
            <li key={idx}>
              {loan.Bank} ({loan["Loan Type "]}) - {loan["Interest Rate"]}%
              <a href={loan.Link} target="_blank" rel="noreferrer">Apply</a>
            </li>
          ))
        ) : (
          <li>No offers available</li>
        )}
      </ul>
    </div>
  );
}

export default ResultCard;
